CREATE DEFINER=`ai-user`@`%` PROCEDURE `addUser`(
	IN p_fullname TEXT,
	IN p_email VARCHAR(100),
	IN p_password VARCHAR(100),
	OUT p_status VARCHAR(250),
	OUT p_code INT,
	OUT p_id INT
)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
         GET DIAGNOSTICS CONDITION 1 @p1 = RETURNED_SQLSTATE, @p2 = MESSAGE_TEXT;
         SET p_status=@p2;
 	END;
	SET p_code = (SELECT FLOOR(RAND()*(9999-1000+1)+1000));
	INSERT INTO users (full_name, email, passwordHash, adminControl, created_at, emailCode)
	VALUES (p_fullname, p_email, SHA2(p_password, 512), 1, CURRENT_TIMESTAMP(), p_code);
	SET p_status = 'Success';
	SET p_id = LAST_INSERT_ID();
    COMMIT;
END ;;
