CREATE DEFINER=`ai-user`@`%` PROCEDURE `changePassword`(
	IN p_userID INT,
	IN p_newpwd VARCHAR(100),
	OUT p_responseMessage VARCHAR(250)
	)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
         GET DIAGNOSTICS CONDITION 1 @p1 = RETURNED_SQLSTATE, @p2 = MESSAGE_TEXT;
         SET p_responseMessage=@p2;
 	END;
	IF (SELECT id FROM users WHERE id=p_userID LIMIT 1)>0 THEN
	    SELECT id, passwordHash  FROM users WHERE id=p_userID;
	    BEGIN
	        UPDATE users SET passwordHash=SHA2(p_newpwd, 512) WHERE id=p_userID;
	        SELECT id, passwordHash  FROM users WHERE id=p_userID;
	        SET p_responseMessage='Successfully Changed Password';
	        COMMIT;
	    END;
	ELSE
	    SET p_responseMessage='Invalid UserID';
	END IF;
	 
 
END ;;
