CREATE DEFINER=`ai-user`@`%` PROCEDURE `userLogin`(
    IN p_email VARCHAR(100),
    IN p_password VARCHAR(100),
    OUT p_userID INT,
    OUT p_responseMessage VARCHAR(250)
)
BEGIN
	DECLARE p_emailVerified tinyint(1);
	DECLARE p_adminControl tinyint(1);
	DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
         GET DIAGNOSTICS CONDITION 1 @p1 = RETURNED_SQLSTATE, @p2 = MESSAGE_TEXT;
         SET p_responseMessage=@p2;
 	END;
    
    IF (SELECT count(id) FROM users WHERE email=p_email LIMIT 1)>0 THEN
      BEGIN
    	SELECT @p_userID:=id, @p_emailVerified:=emailVerified, @p_adminControl:=adminControl FROM users WHERE email=p_email AND passwordHash=SHA2(p_password, 512);
      END;
     
      IF (@p_adminControl = 0) THEN
         SET p_responseMessage = 'Your signin has been disabled. Please contact admin';
         SET p_userID = @p_userID;	
      ELSEIF (@p_emailVerified = 0) THEN
         SET p_responseMessage = 'Validate Email';
         SET p_userID = @p_userID;
      ELSEIF(@p_userID IS NULL) THEN
         SET p_responseMessage = 'Incorrect password';
         SET p_userID = @p_userID; 
      ELSE 
         SET p_userID = @p_userID;
         SET p_responseMessage='User successfully logged in';
      END IF;
    ELSE
       SET p_responseMessage='Invalid login';
    END IF;
 
 
END ;;
