CREATE DEFINER=`ai-user`@`%` PROCEDURE `ValidateUser`(
	IN p_userID INT,
	IN p_code INT,
	OUT p_responseMessage VARCHAR(250)
)
BEGIN
	
	DECLARE p_created_at TIMESTAMP;
	DECLARE p_validated_at TIMESTAMP;
    DECLARE p_diffSec INT;
    
	DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
         GET DIAGNOSTICS CONDITION 1 @p1 = RETURNED_SQLSTATE, @p2 = MESSAGE_TEXT;
         SET p_responseMessage=@p2;
 	END;
	
    SET p_responseMessage = '';
	SET p_validated_at = CURRENT_TIMESTAMP();
    

	SELECT created_at into p_created_at FROM users WHERE id=p_userID AND emailCode=p_code;
    
    SELECT p_created_at;
	IF (p_created_at IS NULL) THEN
		SET p_responseMessage = 'Invalid Code';
	ELSE
        SELECT TIME_TO_SEC(TIMEDIFF(p_validated_at, p_created_at)) into p_diffSec;
        
        IF(p_diffSec > 900) THEN
        	SET p_code = (SELECT FLOOR(RAND()*(9999-1000+1)+1000));
			UPDATE users SET emailCode = p_code, created_at = CURRENT_TIMESTAMP() where id = p_userID;
			COMMIT;
            SET p_responseMessage='Email Code Timed Out (Check your mail for new code)';
        ELSE 
            
            UPDATE users SET validated_at = p_validated_at, emailVerified = 1 where id = p_userID;
            SET p_responseMessage='User Email Validated successfully!';
            COMMIT;
        END IF;
	END IF;
END ;;
